INSERT INTO `home` (`id`, `content`, `onderwerp`, `foto`) VALUES
(1, '<p>Wil je een keertje mee trainen? Leuk! Stuur dan een mailtje naar <a href=\"mailto:bestuur@hydrofiel.nl\">bestuur@hydrofiel.nl</a>.<strong><br></strong></p>\n<p>De zwemtak van Hydrofiel traint twee keer per week:</p>\n<ul>\n<li>Dinsdag: 19.00 - 20.00 uur Ã©n 20.00 - 21.00 uur (inhoudelijk zijn deze trainingen gelijk aan elkaar)</li>\n<li>Donderdag: 21.30 - 22.30 uur</li>\n</ul>\n<p>De waterpolotak van Hydrofiel traint eveneens twee keer per week:</p>\n<ul>\n<li>Dinsdag: 21.00 - 22.30 uur</li>\n<li>Donderdag: 20.00 - 21.30 uur</li>\n</ul>', 'Mee trainen?', 'fotos/groepsfoto.png'),
(2, 'Afgelopen weekend was het alweer tijd voor het allereerste NSZK! Een kleine delegatie reisde op vrijdag al af naar Utrecht om het weekend goed te beginnen op de preborrel. De volgende ochtend sloot ook de rest van de Hydrofielers aan en kon de strijd in het bad losbarsten. Na een dag vol zwemmen, zingen en aanmoedigen zijn wij geeindigd op een 8ste plek. Het weekend eindigde met een groot feest met als thema: around the world. Er werd gedronken, integratiepunten werden gescoord en gedanst tot in de late uurtjes. Blokkeer het weekend van 8-9-10 december maar alvast in je agenda, want dan reizen we met zijn allen af naar de hoofdstad van Nederland: het mooie Amsterdam!', 'NSZK I Utrecht', 'fotos/groepsfoto.png'),
(3, 'Maandag 11 september heeft het 45e bestuur het stokje overgedragen aan het 46e bestuur! Het 45e wenst de dames ontzettend veel succes en plezier! Alle leden bedankt voor afgelopen jaar, wij hebben genoten!\r\n\r\nEn voor de laatste keer:\r\nMet Harde en Natte groet, \r\nHet 45e bestuur\r\nIris, Nicole, Iris, Jan, Bram en Nienke', 'Bestuurswissel', 'fotos/groepsfoto.png');

