(1, 'Home', 'Home', '<div class=\"container\">\r\n  <div class=\"col-md-3\">\r\n    <strong>Bestuurswissel</strong>\r\n    <img class=\"img-responsive no_margin\" src=\"/fotos/13-09-2017 225304 bestuurswissel.jpg\">\r\n  </div>\r\n  <div class=\"col-md-9\" align=\"left\">\r\n    <p class=\"news_content\">Maandag 11 september heeft het 45e bestuur het stokje overgedragen aan het 46e bestuur! Het 45e wenst de\r\n       dames ontzettend veel succes en plezier! Alle leden bedankt voor afgelopen jaar, wij hebben genoten!<br>\r\n       <br>\r\n       En voor de laatste keer:<br>\r\n       Met Harde en Natte groet,<br>\r\n       Het 45e bestuur<br>\r\n       <em>Iris, Nicole, Iris, Jan, Bram en Nienke</em>\r\n    </p>\r\n  </div>\r\n</div>', '<div class=\"container\">\r\n  <div class=\"col-md-3\">\r\n    <strong>Board change</strong>\r\n    <img class=\"img-responsive\" src=\"/fotos/13-09-2017 225304 bestuurswissel.jpg\">\r\n  </div>\r\n  <div class=\"col-md-9\" align=\"left\">\r\n    <p xss=removed>Monday 11 September heeft het 45e bestuur het stokje overgedragen aan het 46e bestuur! Het 45e wenst de\r\n       dames ontzettend veel succes en plezier! Alle leden bedankt voor afgelopen jaar, wij hebben genoten!<br>\r\n       <br>\r\n       En voor de laatste keer:<br>\r\n       Met Harde en Natte groet,<br>\r\n       Het 45e bestuur<br>\r\n       <em>Iris, Nicole, Iris, Jan, Bram en Nienke</em>\r\n    </p>\r\n  </div>\r\n</div>', 1, 'A', 'ja', 'ja', 'nee', 0),
(78, 'Zwemmen', 'Swimming', '<h1>Zwemmen</h1>\r\n<p><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/12-08-2015 223201 Collages.jpg\" alt=\"\" width=\"273\" height=\"486\">De zwemtak van Hydrofiel bestaat uit enthousiaste zwemmers, van beginnende zwemmers tot leden die al jaren competitie zwemmen. Iedereen mag komen zwemmen bij Hydrofiel, echter moet je wel de belangrijkste zwemslagen (borstcrawl, rugcrawl en schoolslag) beheersen om lid te mogen worden. Beheers je deze nog niet, dan kun je een cursus volgen via het Radboud Sportcentrum (<span xss=\"removed\"><a href=\"https://publiek.usc.ru.nl/info/?browser=on?=nl&menu=verberg&mode=activiteit&naam=Zwemmen&standaard=student&type=aanbod\" target=\"_blank\">RSC</a></span>). Na drie maanden kun je dan instromen bij Hydrofiel.</p>\r\n<p>De zwemtak van Hydrofiel traint twee keer per week</p>\r\n<ul>\r\n<li>Dinsdag: 20.00u - 21.00 u </li>\r\n<li>Donderdag: 20:00u - 21:00 u</li>\r\n</ul>\r\n<p>Hydrofiel zwemt mee in de Nederlandse Studenten Zwem Kompetitie. De Stichting NSZK verzorgt in samenwerking met de 11 aangesloten studentenzwemverenigingen deze studentencompetitie. Ieder jaar worden er vier competitiewedstrijden en één NSK georganiseerd in één van de elf studentensteden. </p>\r\n<p>De <a href=\"/page/id/81\"><span>NSZK-wedstrijden</span></a> worden bezocht door zo’n 350 tot 400 studenten en vinden altijd van vrijdag tot en met zondag plaats, waarbij de wedstrijd zelf op zaterdag valt. Het niveau van NSZK- wedstrijden is erg breed, dus ook als je nog niet zo goed kunt zwemmen, is het leuk om een keer te kijken of je trainingen effect hebben gehad. Deze wedstrijden zijn officiele KNZB-wedstrijden, dus ook interessant voor de zwemmers met een startnummer. Na de wedstrijd wordt er met zijn alle gegeten en wordt de dag afgesloten met een spetterend feest. Eén keer in de twee jaar staat het NSZK in Nijmegen op het programma en daar wordt uiteraard iedereen verwacht (al is het alleen om te feesten). <br><br>Naast het deelnemen aan wedstrijden kan er ook alleen <a href=\"/page/id/123\"><span xss=\"removed\">getraind</span></a> worden. De training staat onder leiding van onze professionele trainers, die ons een uur lang alle hoeken van het zwembad laten zien. Na de training gaan we op donderdag nog gezellig een drankje doen bij Café de Kroon.</p>\r\n<p><br>Wil je meer informatie over het zwemmen of over de NSZK wedstrijden, mail dan naar <a href=\"mailto:bestuur@hydrofiel.nl\">bestuur@hydrofiel.nl</a><span xss=\"removed\"><strong></strong></span>.</p>', '<h1>Swimming</h1>\r\n<p><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/12-08-2015 223201 Collages.jpg\" alt=\"\" width=\"273\" height=\"486\">De zwemtak van Hydrofiel bestaat uit enthousiaste zwemmers, van beginnende zwemmers tot leden die al jaren competitie zwemmen. Iedereen mag komen zwemmen bij Hydrofiel, echter moet je wel de belangrijkste zwemslagen (borstcrawl, rugcrawl en schoolslag) beheersen om lid te mogen worden. Beheers je deze nog niet, dan kun je een cursus volgen via het Radboud Sportcentrum (<span xss=\"removed\"><a href=\"https://publiek.usc.ru.nl/info/?browser=on?=nl&menu=verberg&mode=activiteit&naam=Zwemmen&standaard=student&type=aanbod\" target=\"_blank\">RSC</a></span>). Na drie maanden kun je dan instromen bij Hydrofiel.</p>\r\n<p>De zwemtak van Hydrofiel traint twee keer per week</p>\r\n<ul>\r\n<li>Dinsdag: 20.00u - 21.00 u </li>\r\n<li>Donderdag: 20:00u - 21:00 u</li>\r\n</ul>\r\n<p>Hydrofiel zwemt mee in de Nederlandse Studenten Zwem Kompetitie. De Stichting NSZK verzorgt in samenwerking met de 11 aangesloten studentenzwemverenigingen deze studentencompetitie. Ieder jaar worden er vier competitiewedstrijden en één NSK georganiseerd in één van de elf studentensteden. </p>\r\n<p>De <a href=\"/page/id/81\"><span>NSZK-wedstrijden</span></a> worden bezocht door zo’n 350 tot 400 studenten en vinden altijd van vrijdag tot en met zondag plaats, waarbij de wedstrijd zelf op zaterdag valt. Het niveau van NSZK- wedstrijden is erg breed, dus ook als je nog niet zo goed kunt zwemmen, is het leuk om een keer te kijken of je trainingen effect hebben gehad. Deze wedstrijden zijn officiele KNZB-wedstrijden, dus ook interessant voor de zwemmers met een startnummer. Na de wedstrijd wordt er met zijn alle gegeten en wordt de dag afgesloten met een spetterend feest. Eén keer in de twee jaar staat het NSZK in Nijmegen op het programma en daar wordt uiteraard iedereen verwacht (al is het alleen om te feesten). <br><br>Naast het deelnemen aan wedstrijden kan er ook alleen <a href=\"/page/id/123\"><span xss=\"removed\">getraind</span></a> worden. De training staat onder leiding van onze professionele trainers, die ons een uur lang alle hoeken van het zwembad laten zien. Na de training gaan we op donderdag nog gezellig een drankje doen bij Café de Kroon.</p>\r\n<p><br>Wil je meer informatie over het zwemmen of over de NSZK wedstrijden, mail dan naar <a href=\"mailto:bestuur@hydrofiel.nl\">bestuur@hydrofiel.nl</a><span xss=\"removed\"><strong></strong></span>.</p>', 1, 'A', 'ja', 'ja', 'ja', 0),
(79, 'Waterpolo', 'Waterpolo', '<h1>Waterpolo</h1>\r\n<div class=\"center-block\"><br></div>\r\n<p xss=\"removed\">Studenten waterpolovereniging Hydrofiel biedt iedereen, van beginner tot ervaren waterpolo<span class=\"js-about-module-abstr\">ë</span>r, de mogelijkheid om mee te trainen en/of spelen. De waterpolotak van Hydrofiel bestaat uit drie competitie spelende teams en daarnaast recreatieve waterpolo<span class=\"js-about-module-abstr\">ë</span>rs. </p>\r\n<p xss=\"removed\">De <span xss=\"removed\">teams</span> die op dit moment meespelen in de KNZB competitie zijn de Heren 1, Heren 2 en Heren 3 en Dames 1. Heren 1 speelt derde klasse bond, de Heren 2 speelt tweede klasse district en Heren 3 speelt vierde klasse district. Vanaf het seizoen 2018-2019 zal Dames 1 uitkomen in tweede klasse district. <br>\r\n<img class=\"img-responsive\" src=\"/fotos/13-08-2015 144232 14269505941_356b811317_o.jpg\" alt=\"\" xss=\"removed\" width=\"75%\" height=\"auto\"><br>De waterpolotak van Hydrofiel traint twee keer per week:</p>\r\n<ul>\r\n<li>Dinsdag: 21.00 uur - 22.30 uur</li>\r\n<li>Donderdag: 21.00 uur - 22.30 uur</li>\r\n</ul>\r\n<p>Er wordt gezamenlijk getraind onder leiding van onze trainers: Marco van Beuningen en Theo Hermens<br></p>\r\n<div><img class=\"img-responsive\" src=\"/fotos/13-08-2015 144356 14269541681_f73802ed54_o.jpg\" alt=\"\" xss=\"removed\" width=\"75%\" height=\"auto\"></div>\r\n<p><br>Het is absoluut geen vereiste dat je competitie gaat spelen. Binnen Hydrofiel zijn er een hoop waterpolo<span class=\"js-about-module-abstr\">ë</span>rs die alleen meetrainen en daarnaast wel af en toe meedoen aan een NSWK of een van de vele toernooien die Hydrofiel organiseert. <br>Als je nou toch ge<span class=\"js-about-module-abstr\">ï</span>nteresseerd bent in het spelen van wedstrijden maar nog niet gelijk heel veel wedstrijden wil spelen, kun je er voor kiezen om met ons kleine broertje Hydrofoob mee te spelen. Zij spelen in een aparte competitie (NCS competitie). Deze competitie bestaat uit 6 tot 8 minitoernooitjes per jaar. Op zo\'n toernooitje worden er 3 wedstrijden van 2x8 minuten gespeeld. Dit wordt met een gemengd team gedaan.</p><p>De NSWK\'s van seizoen 2018-2019 zullen op de volgende data plaatsvinden:<br>  <span>NSWK 1 – 28 oktober – Amsterdam<span></span></span>  <span><br>NSWK 2 – 16 december – Leiden<span></span></span> <br> <span>NSWK 3 – 17 februari<span></span></span>   <span>–  </span>  <span><br>NSWK 4 – 11 mei – Rotterdam<span></span></span>  <span><span> </span></span>  <br></p>\r\n<img class=\"img-responsive\" src=\"/fotos/13-08-2015 144825 1395131_10154889064675335_6402967783936250623_n.jpg\" alt=\"\" xss=\"removed\" width=\"75%\" height=\"auto\">\r\n<p>Naast de competitiemogelijkheden doen we ook mee aan de verschillende toernooien buiten het seizoen. Meestal doet Hydrofiel mee aan zo\'n 4 a 5 toernooien per jaar. Naast onze deelname aan andere toernooien, organiseren we ook jaarlijks ons eigen buitentoernooi in het Goffertbad. Dit toernooi heet het <a href=\"http://www.gofferttoernooi.nl/\" target=\"_blank\">Gofferttoernooi</a>. Dit toernooi is inmiddels flink gegroeid, er doen zo\'n 35-40 teams aan mee.</p>\r\n<p>Wil je een keer meetrainen of heb je een vraag over de waterpolo bij Hydrofiel? Mail dan naar <span xss=\"removed\"><strong><a href=\"mailto:waterpolocommissaris@hydrofiel.nl\">waterpolocommissaris@hydrofiel.nl</a></strong></span>.</p>', '<h1>Waterpolo</h1>\r\n<div class=\"center-block\">The waterpolobranch of Hydrofiel is open for everyone: from beginner to professional. There are three men competition team, one women team and recreative waterpolo players. </div><div class=\"center-block\"><br>The teams that are playing for the KNZB competition are Mens 1, Mens 2, Mens 3 and Womens 1. The first mens team is playing in third Bond, the second mens team plays in second District and the third mens team plays fourth District. The women play in second district. <br></div>\r\n<br><p xss=\"removed\">\r\n<img class=\"img-responsive\" src=\"https://test.bintzandt.nl/fotos/13-08-2015 144232 14269505941_356b811317_o.jpg\" alt=\"\" width=\"75%\" height=\"auto\">There are two trainings every week:</p>\r\n<ul><li>Tuesday : 21.00 - 22.30 <br></li><li>Thursday : 21.00 - 22.30 <br></li></ul>\r\n<p>All teams train at the same moment under the supervision of our trainers Marco van Beuningen and Theo Hermens<br></p>\r\n<div><img class=\"img-responsive\" src=\"https://test.bintzandt.nl/fotos/13-08-2015 144356 14269541681_f73802ed54_o.jpg\" alt=\"\" width=\"75%\" height=\"auto\"></div>\r\n<p>It is definitely no obligation to join a competition team. There are a lot of members who only participate in trainings. Aside of joining a competition team, there is the possibility to join a NSWK (Dutch student waterpolo competition) or one of the other tournaments during the year. <br>If you are interested in playing competitions, but you don\'t want to play many matches, you can choose to join Hydrofiels little brother-association Hydrofoob. They play in a separate competition (NCS competition). This competition contains 6 to 8 mini-tournaments per year. At such a tournament, the team will play 3 games of 2x8 minutes. This is played in a mixed team.</p><p>The NSWK dates of the season of 2018-2019 are:<br> <span>NSWK 1 – 28 oktober – Amsterdam<span></span></span>  <span><br>NSWK 2 – 16 december – Leiden<span></span></span> <br> <span>NSWK 3 – 17 februari<span></span></span>   <span>–  </span>  <span><br>NSWK 4 – 11 mei – Rotterdam<span></span></span>  <span><span> </span></span>  <br></p><p><img class=\"img-responsive\" src=\"https://test.bintzandt.nl/fotos/13-08-2015 144825 1395131_10154889064675335_6402967783936250623_n.jpg\" alt=\"\" width=\"75%\" height=\"auto\">\r\n</p><p>Apart of the competition possibilities mentioned above, there is the possibility to join several tournaments after the competition season. We aim to join 4 to 5 tournaments a year. Apart of the participation in those tournaments, we annually organise our own tournament in the outside pool of \'The Goffertbad\'. This tournament is named the <a href=\"http://www.gofferttoernooi.nl/\" target=\"_blank\">Gofferttoernooi</a>. Over the years, this tournament has grown a lot. There are approximately 35-40 teams participating. </p><p>Would you like to join a practise or do you have a question about waterpolo at Hydrofiel? You can send an email to <span xss=\"removed\"><strong><a href=\"mailto:waterpolocommissaris@hydrofiel.nl\">waterpolocommissaris@hydrofiel.nl</a></strong></span>.</p>', 1, 'A', 'ja', 'ja', 'ja', 0),
(80, 'Teams', 'Teams', '<h1>Waterpolo Teams</h1>\r\n<p>Hydrofiel heeft op dit moment drie teams in de KNZB competitie.</p>\r\n<h3>Heren 1</h3>\r\n<p>De Heren 1 speelt op dit moment derde klasse bond. De Heren 1 bestaat uit meer ervaren waterpolospelers en jonge talenten. Na afgelopen jaar kampioen te zijn geworden in de eerste klasse district, gaan ze aankomend jaar vlammen in de derde klasse bond. <br></p>\r\n<p><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/14-11-2016 142732 H1.jpg\" alt=\"Hydrofiel H1\" width=\"561\" height=\"315\"></p>\r\n<h3>Heren 2</h3>\r\n<p>De Heren 2 speelt op dit moment derde klasse district. Het team bestaat momenteel voornamelijk uit studenten. Een leuke mix en een hecht team. Vanuit de Heren 2 is er de kans om door te stromen naar de Heren 1. Heren 2 doet na de training of wedstrijd nog graag een biertje!</p>\r\n\r\n<h3><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/17-09-2017 192054 Teamfoto_H2.jpeg\" alt=\"Teamfoto Heren 2\" width=\"511\" height=\"383\"></h3>\r\n\r\n<h3>Heren 3</h3>\r\n<p>Heren 3 speelt momenteel vierde klasse district. Het team bestaat voornamelijk uit oud-studenten. Deze mannen hebben veel spelervaring en spelen al lang in ongeveer dezelfde samenstelling bij Hydrofiel!</p>\r\n<h3><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/13-08-2015 145038 IMG_1744.JPG\" alt=\"\" width=\"526\" height=\"350\"></h3>\r\n<h3>Dames 1</h3>\r\n<p>Vanaf het seizoen 2018-2019 zal Hydrofiel weer een damesteam hebben! Het damesteam zal uitkomen in de tweede klasse district. Deze gezellige groep dames gaat ervoor om lekker te knallen als nieuwkomer in de tweede klasse!<br></p>\r\n<img class=\"img-responsive\" src=\"/fotos/15-03-2018 waterpolodames.jpg\" alt=\"Waterpolo dames\" width=\"561\" height=\"383\">', '<h1>Waterpolo Teams</h1>\r\n<p>Hydrofiel heeft op dit moment drie teams in de KNZB competitie.</p>\r\n<h3>Heren 1</h3>\r\n<p>De Heren 1 speelt op dit moment derde klasse bond. De Heren 1 bestaat uit meer ervaren waterpolospelers en jonge talenten. Na afgelopen jaar kampioen te zijn geworden in de eerste klasse district, gaan ze aankomend jaar vlammen in de derde klasse bond. <br></p>\r\n<p><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/14-11-2016 142732 H1.jpg\" alt=\"Hydrofiel H1\" width=\"561\" height=\"315\"></p>\r\n<h3>Heren 2</h3>\r\n<p>De Heren 2 speelt op dit moment derde klasse district. Het team bestaat momenteel voornamelijk uit studenten. Een leuke mix en een hecht team. Vanuit de Heren 2 is er de kans om door te stromen naar de Heren 1. Heren 2 doet na de training of wedstrijd nog graag een biertje!</p>\r\n\r\n<h3><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/17-09-2017 192054 Teamfoto_H2.jpeg\" alt=\"Teamfoto Heren 2\" width=\"511\" height=\"383\"></h3>\r\n\r\n<h3>Heren 3</h3>\r\n<p>Heren 3 speelt momenteel vierde klasse district. Het team bestaat voornamelijk uit oud-studenten. Deze mannen hebben veel spelervaring en spelen al lang in ongeveer dezelfde samenstelling bij Hydrofiel!</p>\r\n<h3><img class=\"img-responsive\" xss=\"removed\" src=\"/fotos/13-08-2015 145038 IMG_1744.JPG\" alt=\"\" width=\"526\" height=\"350\"></h3>\r\n<h3>Dames 1</h3>\r\n<p>Vanaf het seizoen 2018-2019 zal Hydrofiel weer een damesteam hebben! Het damesteam zal uitkomen in de tweede klasse district. Deze gezellige groep dames gaat ervoor om lekker te knallen als nieuwkomer in de tweede klasse!<br></p>\r\n<img class=\"img-responsive\" src=\"/fotos/15-03-2018 waterpolodames.jpg\" alt=\"Waterpolo dames\" width=\"561\" height=\"383\">', 1, '79', 'ja', 'ja', 'ja', 0),
(81, 'NSZK', 'NSZK', '<h1>NSZK Wedstrijden</h1>\r\n<p><img class=\"img-responsive\" xss=\"removed\" src=\"//hydrofiel.nl/fotos/12-08-2015 220852 10373501_935163329833358_202935031328900941_n.jpg\" alt=\"\" width=\"160\" height=\"147\"></p>\r\n<p>Hydrofiel doet al jaren mee aan een specifieke Nederlandse Studenten Zwem Kompetitie binnen de KNZB (Koninklijke Nederlandse Zwem Bond), waaraan zo\'n 300 à 400 studenten afkomstig van 11 verschillende studenten zwem- (en waterpolo)verenigingen deelnemen. De competitie bestaat uit 5 wedstrijden die ieder jaar afwisselend worden georganiseerd door de 11 verenigingen. Een NS(Z)K wedstrijd begint op vrijdagavond met een pre-borrel, waarna op zaterdagmiddag rond 12 uur de wedstrijd van start gaat. Tijdens de wedstrijd kun je individueel en in estafette vorm verschillende afstanden zwemmen. Na de wedstrijd eten we met alle studenten samen waarna we \'s avonds een mooi feestje bouwen.</p>\r\n<p>Het niveau van NSZK-wedstrijden is erg breed, dus ook als beginnend zwemmer is het leuk om eens te kijken of je trainingen effect hebben gehad. Aangezien de wedstrijden officiele KNZB-wedstrijden zijn, zijn ze ook interessant voor de zwemmers met een startnummer. </p>\r\n<p>Naast het leveren van indiviudele prestaties tijdens de wedstrijden, scoor je als deelnemer punten voor de vereniging. Het is natuurlijk de bedoeling dat we als vereniging zo hoog mogelijk in de ranglijst eindigen, waarbij er ieder jaar weer wordt gestreden voor de kampioensbeker. </p>\r\n<h1><img class=\"img-responsive\" xss=\"removed\" src=\"//hydrofiel.nl/fotos/26-10-2016 235251 NSZ&WV-Hydrofiel-NSZK-I-Wageningen-15.jpg\" alt=\"\" width=\"552\" height=\"368\"></h1>\r\n<p>Voor komend seizoen staan de volgende NSZK\'s en NSK gepland:</p>\r\n<ul>\r\n<li><b>NSZK I Nijmegen: 20 oktober 2018</b></li>\r\n<li>NSZK II Groningen: 8 december 2018</li>\r\n<li>ONKS Rotterdam: 23 februari 2019</li>\r\n<li>NSZK III Amsterdam: 30 maart 2019</li>\r\n<li>NSZK IV Enschede: 15 juni 2019</li>\r\n</ul>\r\n', '<h1>NSZK Wedstrijden</h1>\r\n<p><img class=\"img-responsive\" xss=\"removed\" src=\"//hydrofiel.nl/fotos/12-08-2015 220852 10373501_935163329833358_202935031328900941_n.jpg\" alt=\"\" width=\"160\" height=\"147\"></p>\r\n<p>Hydrofiel doet al jaren mee aan een specifieke Nederlandse Studenten Zwem Kompetitie binnen de KNZB (Koninklijke Nederlandse Zwem Bond), waaraan zo\'n 300 à 400 studenten afkomstig van 11 verschillende studenten zwem- (en waterpolo)verenigingen deelnemen. De competitie bestaat uit 5 wedstrijden die ieder jaar afwisselend worden georganiseerd door de 11 verenigingen. Een NS(Z)K wedstrijd begint op vrijdagavond met een pre-borrel, waarna op zaterdagmiddag rond 12 uur de wedstrijd van start gaat. Tijdens de wedstrijd kun je individueel en in estafette vorm verschillende afstanden zwemmen. Na de wedstrijd eten we met alle studenten samen waarna we \'s avonds een mooi feestje bouwen.</p>\r\n<p>Het niveau van NSZK-wedstrijden is erg breed, dus ook als beginnend zwemmer is het leuk om eens te kijken of je trainingen effect hebben gehad. Aangezien de wedstrijden officiele KNZB-wedstrijden zijn, zijn ze ook interessant voor de zwemmers met een startnummer. </p>\r\n<p>Naast het leveren van indiviudele prestaties tijdens de wedstrijden, scoor je als deelnemer punten voor de vereniging. Het is natuurlijk de bedoeling dat we als vereniging zo hoog mogelijk in de ranglijst eindigen, waarbij er ieder jaar weer wordt gestreden voor de kampioensbeker. </p>\r\n<h1><img class=\"img-responsive\" xss=\"removed\" src=\"//hydrofiel.nl/fotos/26-10-2016 235251 NSZ&WV-Hydrofiel-NSZK-I-Wageningen-15.jpg\" alt=\"\" width=\"552\" height=\"368\"></h1>\r\n<p>Voor komend seizoen staan de volgende NSZK\'s en NSK gepland:</p>\r\n<ul>\r\n<li><b>NSZK I Nijmegen: 20 oktober 2018</b></li>\r\n<li>NSZK II Groningen: 8 december 2018</li>\r\n<li>ONKS Rotterdam: 23 februari 2019</li>\r\n<li>NSZK III Amsterdam: 30 maart 2019</li>\r\n<li>NSZK IV Enschede: 15 juni 2019</li>\r\n</ul>\r\n', 1, '78', 'ja', 'ja', 'ja', 0),
(83, 'Vereniging', 'Association', '<h1>Hydrofiel                 <img xss=\"removed\" src=\"/fotos/02-09-2015 143100 sticker hydro.jpg\" alt=\"\" width=\"150\" height=\"149\"></h1>\r\n<p>Hydrofiel is dé studenten zwem- en waterpolovereniging van Nijmegen! Kortom: twee sporten, één vereniging! De combinatie van enthousiaste zwemmers en waterpoloërs maakt ons tot een unieke studentensportvereniging die haar leden de mogelijkheid geeft om op een sportieve en gezellige manier in clubverband haar sport te beoefenen.</p>\r\n<h1><img xss=\"removed\" src=\"/fotos/02-09-2015 144940 DSC_5005.jpg\" alt=\"\" width=\"231\" height=\"153\"></h1>\r\n<p> </p>\r\n<p> </p>\r\n<p> De <span xss=\"removed\"><a href=\"/page/id/78\">zwemtak</a></span> bestaat uit fanatieke zwemmers: van beginneling tot ervaren  competitiezwemmer (van sopper tot topper). Gedurende het seizoen worden vier NSZK ’s  (Nederlandse Studenten Zwem Kompetitie) georganiseerd. Alle Nederlandse  studentenzwemverenigingen nemen deel aan deze leuke weekenden, waarin ieder op zijn  eigen niveau de strijd aangaat.</p>\r\n<p> </p>\r\n<p><img xss=\"removed\" src=\"/fotos/02-09-2015 150200 Hydrofiel.jpg\" alt=\"\" width=\"301\" height=\"170\"></p>\r\n<p> </p>\r\n<p>De <span xss=\"removed\"><a href=\"/page/id/79\">waterpolotak</a></span> bestaat uit drie ijverige Herenteams, vanaf het jaar 2018-2019  een gemotiveerd Damesteam en recreatieve waterpoloërs! De Heren I speelt derde klasse bond, de Heren II speelt tweede klasse district en heren III speelt vierde klasse district. De Dames gaan volgend jaar starten in tweede klasse district.  Ook als je wel graag wilt komen trainen, maar liever geen wedstrijden speelt, ben je bij ons op de juiste plek! Elk jaar worden verschillende (buiten)toernooien gespeeld. Deze zijn toegankelijk voor de ervaren en de recreatieve waterpoloër.</p>\r\n<p>  <br></p>\r\n<p>Naast sportieve activiteiten is Hydrofiel ook actief op het droge. Maandelijks wordt er iets georganiseerd buiten het bad: gezellige borrels, een bierproeverij, ons eigen Hydrofielweekend, een barbecue en ga zo maar door! </p>\r\n<p><br> Ben je nieuwsgierig? Iedereen is welkom en wordt begeleid door onze gedreven, professionele trainers. </p>', '<h1>Hydrofiel                 <img xss=\"removed\" src=\"/fotos/02-09-2015 143100 sticker hydro.jpg\" alt=\"\" width=\"150\" height=\"149\"></h1>\r\n<p>              <span lang=\"EN-GB\">Hydrofiel  is <u>the</u> students swim and water polo association of Nijmegen! In short:  two sports, one association! The combination of enthusiastic swimmers and water  polo players<span>  </span>makes up a unique student  sports association, which provides the opportunity for her members to practice  their sport in a sportive and social environment.</span>            </p><h1><img xss=\"removed\" src=\"/fotos/02-09-2015 144940 DSC_5005.jpg\" alt=\"\" width=\"231\" height=\"153\"></h1>\r\n<p> </p>\r\n<p> </p>\r\n<p>               <span lang=\"EN-GB\">The <u>swimming  section</u> consists of fanatic swimmers: from starter to experienced competition  swimmer. During the season there will be four </span><span lang=\"EN-GB\">NSZK ’s  (Nederlandse Studenten Zwem Kompetitie –  translated: Dutch Student Swim Competition) organized. All Dutch student swim </span><span lang=\"EN-GB\">associations take part at these fun  weekends, in which everyone is challenged at his own level.</span>            </p><p><img xss=\"removed\" src=\"/fotos/02-09-2015 150200 Hydrofiel.jpg\" alt=\"\" width=\"301\" height=\"170\"></p>\r\n<p> </p>\r\n<p>              <span lang=\"EN-GB\">The <u>water  polo section</u> consists out of three zealous men teams, a very motivated  ladies team and some recreational water polo players! If you just like to join  the training and rather not pay competition, you’re at the right spot with us!  Also each year, there are several (outside) tournaments. These tournaments are  also accessible for experienced recreational players. </span>            </p><p>              <span lang=\"EN-GB\">Besides  activities in sports, Hydrofiel also is very active on dry land. On a monthly  base there’ll be something organised outside the pool, be it a drink, a  beertasting, our very own Hydrofiel weekend, a barbecue… and the list goes on  and on!</span> </p><p>   <span lang=\"EN-GB\">Curious?  Everyone is welcome and guided by our professional trainers</span>            </p><p> </p>', 1, 'A', 'ja', 'ja', 'ja', 0);
