INSERT INTO `pagina` (`id`, `naam`, `engelse_naam`, `tekst`, `engels`, `plaats`, `submenu`, `zichtbaar`, `bereikbaar`, `cmspagina`, `ingelogd`) VALUES
(85, 'Commissies', 'Committees', '<h1><strong>Commissies</strong></h1>\r\n<p>Net zoals elke vereniging, kan ook Hydrofiel niet bestaan zonder haar actieve leden. Onze actieve leden zetten zich gedurende het jaar met heel veel enthousiasme in voor de vereniging op allerlei verschillende manieren. Ze nemen plaats in verschillende commissies die bijvoorbeeld toernooien, activiteiten of feesten organiseren. Heb jij interesse om in één van de commissies plaats te nemen? Stuur dan een mailtje naar <a href=\"mailto:bestuur@hydrofiel\">bestuur@hydrofie</a>l.nl! Aan het begin van ieder jaar worden de commissies opnieuw gevuld en is er in alle commissies plek. Ben je pas later lid geworden of bedenk je je pas na een paar maanden dat je zin hebt om actief te worden,  vraag dan bij een bestuurslid na in welke commissies nog een plekje vrij is! <br><br>De vele commissies die Hydrofiel kent, staan hieronder op een rijtje. </p>\r\n<h3>Adviescommissie</h3>\r\n<p>De adviescommissie bestaat uit 2 of 3 personen. De leden van de adviescommissie ontvangen de notulen van de bestuursvergaderingen en adviseren het bestuur op allerlei gebied. Het voornamelijkste doel van de adviescommissie is het ondersteunen van het bestuur in het nemen van bestuurlijke beslissingen.</p>\r\n<h3>Activiteitencommissie</h3>\r\n<p>De activiteitencommissie is vaak een van de grootste commissies. Ze organiseren, zoals de naam al zegt, de maandelijkse activiteiten waar veel Hydrofielers enthousiast aan deelnemen. Voorbeelden van activiteiten zijn bowlen, lasergamen, een biercantus, spelletjesavond, sinterklaasactiviteit... noem maar op! Ook gaat Hydrofiel ieder jaar op Hydrofiel weekend, een weekend dat ieder jaar weer fantastische herinneringen voortbrengt.</p>\r\n<h3>Batavierencommissie</h3>\r\n<p>De Batavierenrace is \'s werelds grootste estafette, waarbij studenten uit heel Nederland in estafettevorm van Nijmegen naar Enschede hardlopen. De batavierencommissie draagt zorgt voor een goed gevuld lopersteam dat door middel van georganiseerde looptrainingen ieder jaar weer een goede prestatie neerzet.</p>\r\n<h3>Bepcommissie</h3>\r\n<p>Vier à vijf keer per jaar brengt de Bepcommissie het verenigingsblad uit dat volstaat met verslagen van activiteiten, foto\'s, quotes, wist-je-datjes, interviews met Hydrofielers en ander leuks. Tijdens het lezen of schrijven van de Bep zal er gegarandeerd een grote glimlach op je gezicht staan.</p>\r\n<h3>Goffertcommissie</h3>\r\n<p>Een van de trotsen van Hydrofiel is het Gofferttoernooi, dat ieder jaar door de goffertcommissie wordt georganiseerd en plaatsvindt in juni. Ieder jaar weer doen er meer dan 30 teams mee aan het Gofferttoernooi dat plaatsvindt in het mooie Goffertbad in Nijmegen.</p>\r\n<h3>Kascontrolecommissie</h3>\r\n<p>De kascontrolecommissie wordt over het algemeen ingevuld door oud-penningmeesters, die een controlerende functie uitvoeren voor de huidige penningmeester.</p>\r\n<h3>NSZK commissie</h3>\r\n<p>Eens in de twee jaar komt het mooiste toernooi van Nederland naar Nijmegen, namelijk het NSZK. Deze commissie regelt alles rondom ons NSZK: het badwater, het eten, de feestlocatie en de slaapplekken.</p>\r\n<h3>Sponsorcommissie</h3>\r\n<p>Deze commissie houdt zich bezig met het vinden van sponsoren voor Hydrofiel. Daarnaast heeft de commissie afgelopen jaar de Hydrofiel merchandise uitgebreid met mooie nieuwe shirts en broekjes. Komend jaar zullen daar nog meerdere andere artikelen bij komen.<br></p>\r\n<h3>Webcommissie</h3>\r\n<p>Deze commissie houdt zich bezig met het onderhoud van de website.</p>\r\n<h3>Wervingscommissie</h3>\r\n<p>De wervingscommissie organiseert 1 keer per jaar een open feest, welke vaak gegeven wordt in samenwerking met andere verenigingen. Ook organiseren ze diverse activiteiten tijdens de introductie van zowel de RU als de Han.<br>Ten slotte is deze commissie verantwoordelijk voor het werven en behouden van nieuwe leden en het creëren van naamsbekendheid onder de studenten van Nijmegen.</p>\r\n<p> </p>\r\n<h3>Lustrumcommissie</h3>\r\n<p>De lustrumcommissie houdt zich in het Lustrumjaar bezig met het organiseren van verschillende activiteiten ter viering van het Lustrum van Hydrofiel. Deze commissie is dus ook alleen actief tijdens een Lustrumjaar.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', '<h1><strong>Commissies</strong></h1>\r\n<p>Net zoals elke vereniging, kan ook Hydrofiel niet bestaan zonder haar actieve leden. Onze actieve leden zetten zich gedurende het jaar met heel veel enthousiasme in voor de vereniging op allerlei verschillende manieren. Ze nemen plaats in verschillende commissies die bijvoorbeeld toernooien, activiteiten of feesten organiseren. Heb jij interesse om in één van de commissies plaats te nemen? Stuur dan een mailtje naar <a href=\"mailto:bestuur@hydrofiel\">bestuur@hydrofie</a>l.nl! Aan het begin van ieder jaar worden de commissies opnieuw gevuld en is er in alle commissies plek. Ben je pas later lid geworden of bedenk je je pas na een paar maanden dat je zin hebt om actief te worden,  vraag dan bij een bestuurslid na in welke commissies nog een plekje vrij is! <br><br>De vele commissies die Hydrofiel kent, staan hieronder op een rijtje. </p>\r\n<h3>Adviescommissie</h3>\r\n<p>De adviescommissie bestaat uit 2 of 3 personen. De leden van de adviescommissie ontvangen de notulen van de bestuursvergaderingen en adviseren het bestuur op allerlei gebied. Het voornamelijkste doel van de adviescommissie is het ondersteunen van het bestuur in het nemen van bestuurlijke beslissingen.</p>\r\n<h3>Activiteitencommissie</h3>\r\n<p>De activiteitencommissie is vaak een van de grootste commissies. Ze organiseren, zoals de naam al zegt, de maandelijkse activiteiten waar veel Hydrofielers enthousiast aan deelnemen. Voorbeelden van activiteiten zijn bowlen, lasergamen, een biercantus, spelletjesavond, sinterklaasactiviteit... noem maar op! Ook gaat Hydrofiel ieder jaar op Hydrofiel weekend, een weekend dat ieder jaar weer fantastische herinneringen voortbrengt.</p>\r\n<h3>Batavierencommissie</h3>\r\n<p>De Batavierenrace is \'s werelds grootste estafette, waarbij studenten uit heel Nederland in estafettevorm van Nijmegen naar Enschede hardlopen. De batavierencommissie draagt zorgt voor een goed gevuld lopersteam dat door middel van georganiseerde looptrainingen ieder jaar weer een goede prestatie neerzet.</p>\r\n<h3>Bepcommissie</h3>\r\n<p>Vier à vijf keer per jaar brengt de Bepcommissie het verenigingsblad uit dat volstaat met verslagen van activiteiten, foto\'s, quotes, wist-je-datjes, interviews met Hydrofielers en ander leuks. Tijdens het lezen of schrijven van de Bep zal er gegarandeerd een grote glimlach op je gezicht staan.</p>\r\n<h3>Goffertcommissie</h3>\r\n<p>Een van de trotsen van Hydrofiel is het Gofferttoernooi, dat ieder jaar door de goffertcommissie wordt georganiseerd en plaatsvindt in juni. Ieder jaar weer doen er meer dan 30 teams mee aan het Gofferttoernooi dat plaatsvindt in het mooie Goffertbad in Nijmegen.</p>\r\n<h3>Kascontrolecommissie</h3>\r\n<p>De kascontrolecommissie wordt over het algemeen ingevuld door oud-penningmeesters, die een controlerende functie uitvoeren voor de huidige penningmeester.</p>\r\n<h3>NSZK commissie</h3>\r\n<p>Eens in de twee jaar komt het mooiste toernooi van Nederland naar Nijmegen, namelijk het NSZK. Deze commissie regelt alles rondom ons NSZK: het badwater, het eten, de feestlocatie en de slaapplekken.</p>\r\n<h3>Sponsorcommissie</h3>\r\n<p>Deze commissie houdt zich bezig met het vinden van sponsoren voor Hydrofiel. Daarnaast heeft de commissie afgelopen jaar de Hydrofiel merchandise uitgebreid met mooie nieuwe shirts en broekjes. Komend jaar zullen daar nog meerdere andere artikelen bij komen.<br></p>\r\n<h3>Webcommissie</h3>\r\n<p>Deze commissie houdt zich bezig met het onderhoud van de website.</p>\r\n<h3>Wervingscommissie</h3>\r\n<p>De wervingscommissie organiseert 1 keer per jaar een open feest, welke vaak gegeven wordt in samenwerking met andere verenigingen. Ook organiseren ze diverse activiteiten tijdens de introductie van zowel de RU als de Han.<br>Ten slotte is deze commissie verantwoordelijk voor het werven en behouden van nieuwe leden en het creëren van naamsbekendheid onder de studenten van Nijmegen.</p>\r\n<p> </p>\r\n<h3>Lustrumcommissie</h3>\r\n<p>De lustrumcommissie houdt zich in het Lustrumjaar bezig met het organiseren van verschillende activiteiten ter viering van het Lustrum van Hydrofiel. Deze commissie is dus ook alleen actief tijdens een Lustrumjaar.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', 0, '83', 'ja', 'ja', 'ja', 1);
