INSERT INTO `pagina` (`id`, `naam`, `engelse_naam`, `tekst`, `engels`, `plaats`, `submenu`, `zichtbaar`, `bereikbaar`, `cmspagina`, `ingelogd`) VALUES
(122, 'Lid worden?', 'Become a member', '<h1>Lid worden?</h1>\r\n<p>Wij raden het aan om eerst een keer mee te komen trainen bij Hydrofiel voordat je beslist of je lid wil worden. Op die manier weet je zeker dat wij als vereniging bij jou passen. <br><br>Wil je een keer een zwemtraining volgen? Stuur dan een mailtje naar <span xss=\"removed\"><a href=\"mailto:zwemcommissaris@hydrofiel.nl\">zwemcommissaris@hydrofiel.nl</a></span>.<br>Voor het volgen van een waterpolotraining kan je mailen naar <span xss=\"removed\"><a href=\"mailto:waterpolocommissaris@hydrofiel.nl\">waterpolocommissaris@hydrofiel.nl</a></span>. <br>Onze zwem- en waterpolocommissaris zullen je meer informatie geven over de trainingstijden en -mogelijkheden van die week. Kom je meetrainen en heb je al een sportkaart? Neem deze dan altijd mee.</p>\r\n<p>Wil je lid worden? Vraag voor of na een training om een inschrijfformulier bij een van de bestuursleden of download het formulier hieronder! Zij kunnen vragen over het lidmaatschap beantwoorden. Voor de gezichten bij de functies, zie het tabblad \"<span xss=\"removed\"><a href=\"/page/id/109\">bestuur</a></span>\".</p>\r\n<p><br></p>', '<h1>Become a member?</h1>\r\n<p><span lang=\"EN-GB\">We strongly  advise everyone to first attend to a training, before you decide to join a  membership. At this way you know for sure, that our community fits your needs. </span></p><p>    <span lang=\"EN-GB\">If you  would like to join a swim training, please mail </span><a href=\"mailto:zwemcommissaris@hydrofiel.nl\"><span lang=\"EN-GB\">zwemcommissaris@hydrofiel.nl</span></a><span lang=\"EN-GB\"></span> </p><p><span lang=\"EN-GB\">If you  would like to join a water polo training, please mail </span><a href=\"mailto:waterpolocommissaris@hydrofiel.nl\"><span lang=\"EN-GB\">waterpolocommissaris@hydrofiel.nl</span></a><span lang=\"EN-GB\"> </span></p><p>    <span lang=\"EN-GB\">Our swim or  water polo commissioner can provide you information about the possibilities and  time schedules of the trainings for that week. If you are already in possession  of a sports card, please bring it with you.</span> </p><p><span lang=\"EN-GB\">Would you  like to become a member? Please ask for an application form before or after the  training at the board. They can also answer any question about membership. If  you’d like to know for who you are looking, click the tab, that is called  “Board”.</span>            </p><p><br></p>', 1, '1', 'ja', 'ja', 'ja', 0),
(87, 'Mathilde Gilde', 'Mathilde Gilde', '<h1>Mathilde Gilde</h1>\r\n<p>Onze mooie vereniging is opgericht in 1972 en heeft in de loop der jaren heel wat mooie herinneringen gemaakt. Leden die buitengewoon veel voor de vereniging hebben betekend, wil Hydrofiel op een bijzondere manier aan zich verbinden. Het <em>Mathilde Gilde</em>&nbsp;biedt hier mooie gelegenheid toe. Binnen het gilde zijn drie niveaus te onderscheiden:<br /><br /><strong>Grootmeester<br /></strong>Een erelid van Hydrofiel krijgt als titel \"Grootmeester\". Zonder deze betreffende persoon had Hydrofiel niet in haar huidige vorm bestaan.</p>\r\n<p>- Babette Doorn<br />- Wilma Hofstraat-Dickman</p>\r\n<p><br /><strong>Meester<br /></strong>Een lid van verdienste krijgt als titel \"Meester\". Deze persoon heeft meer inzet en enthousiasme getoond dan redelijkerwijs van een Hydrofiel-lid verwacht mag worden.</p>\r\n<p>- Anne Vervoort<br />- Frank Askamp<br />- Arnold Elbers<br />- Wilfried Bloemberg<br />- Linda van Haren<br />- Rob Hofstraat<br />- Edwin op \'t Landt<br />- Len Lucas<br />- Mark Smits<br />- Eddy Weijn<br />- Martin van Zoelen<br />- Gies Bouwman<br /><br /><strong>Gezel<br /></strong>Een lid die een positieve bijdrage heeft geleverd aan de vereniging krijgt als titel &ldquo;Gezel&rdquo;. Een Gezel is een voorbeeld voor andere leden en heeft zich buiten de primaire doelstellingen van de vereniging actief opgesteld.</p>\r\n<p>- Kevin Mori<br />- Marcel Hoff<br />- Inge van Dijke<br />- Simone Jongen</p>\r\n<p><br />Meer informatie over het Mathilde Gilde kun je teruglezen in het Huishoudelijk Regelement, artikel 7.</p>\r\n<p><br /><br /></p>', '<h1>Mathilde Gilde</h1>\r\n<p>Onze mooie vereniging is opgericht in 1972 en heeft in de loop der jaren heel wat mooie herinneringen gemaakt. Leden die buitengewoon veel voor de vereniging hebben betekend, wil Hydrofiel op een bijzondere manier aan zich verbinden. Het <em>Mathilde Gilde</em>&nbsp;biedt hier mooie gelegenheid toe. Binnen het gilde zijn drie niveaus te onderscheiden:<br /><br /><strong>Grootmeester<br /></strong>Een erelid van Hydrofiel krijgt als titel \"Grootmeester\". Zonder deze betreffende persoon had Hydrofiel niet in haar huidige vorm bestaan.</p>\r\n<p>- Babette Doorn<br />- Wilma Hofstraat-Dickman</p>\r\n<p><br /><strong>Meester<br /></strong>Een lid van verdienste krijgt als titel \"Meester\". Deze persoon heeft meer inzet en enthousiasme getoond dan redelijkerwijs van een Hydrofiel-lid verwacht mag worden.</p>\r\n<p>- Anne Vervoort<br />- Frank Askamp<br />- Arnold Elbers<br />- Wilfried Bloemberg<br />- Linda van Haren<br />- Rob Hofstraat<br />- Edwin op \'t Landt<br />- Len Lucas<br />- Mark Smits<br />- Eddy Weijn<br />- Martin van Zoelen<br />- Gies Bouwman<br /><br /><strong>Gezel<br /></strong>Een lid die een positieve bijdrage heeft geleverd aan de vereniging krijgt als titel &ldquo;Gezel&rdquo;. Een Gezel is een voorbeeld voor andere leden en heeft zich buiten de primaire doelstellingen van de vereniging actief opgesteld.</p>\r\n<p>- Kevin Mori<br />- Marcel Hoff<br />- Inge van Dijke<br />- Simone Jongen</p>\r\n<p><br />Meer informatie over het Mathilde Gilde kun je teruglezen in het Huishoudelijk Regelement, artikel 7.</p>\r\n<p><br /><br /></p>', 1, '83', 'ja', 'ja', 'ja', 1),
(88, 'Vrienden Hydrofiel', 'Friends of Hydrofiel', '<h1><strong>Vrienden van Hydrofiel</strong></h1>\r\n<p>Op deze pagina vindt u de vrienden van de vereniging.<br /><br />Het concept &ldquo;Vrienden van Hydrofiel&rdquo; biedt oud-leden de ultieme kans om op de hoogte te blijven van het reilen en zeilen binnen onze mooie vereniging Hydrofiel. Vrienden dragen de vereniging ook n&aacute; het lidmaatschap een warm hart toe.<br /><br />Ben je ge&iuml;nteresseerd in het concept &ldquo;Vrienden van Hydrofiel&rdquo; of heb je een vraag of opmerking, wij horen deze graag! Je kan ons bereiken via <span style=\"text-decoration: underline;\"><a href=\"mailto:bestuur@hydrofiel.nl\">bestuur@hydrofiel.nl</a></span>.</p>\r\n<p><strong>Vrienden<br /></strong></p>\r\n<p><strong>-&nbsp;</strong>Anne Aarts<br />- Anne Vervoort<br />- Bart Alberts<br />- Harm van Hassel<br />- Hein van Tiel<br />- Nick Althuizen</p>', '<h1><strong>Vrienden van Hydrofiel</strong></h1>\r\n<p>Op deze pagina vindt u de vrienden van de vereniging.<br /><br />Het concept &ldquo;Vrienden van Hydrofiel&rdquo; biedt oud-leden de ultieme kans om op de hoogte te blijven van het reilen en zeilen binnen onze mooie vereniging Hydrofiel. Vrienden dragen de vereniging ook n&aacute; het lidmaatschap een warm hart toe.<br /><br />Ben je ge&iuml;nteresseerd in het concept &ldquo;Vrienden van Hydrofiel&rdquo; of heb je een vraag of opmerking, wij horen deze graag! Je kan ons bereiken via <span style=\"text-decoration: underline;\"><a href=\"mailto:bestuur@hydrofiel.nl\">bestuur@hydrofiel.nl</a></span>.</p>\r\n<p><strong>Vrienden<br /></strong></p>\r\n<p><strong>-&nbsp;</strong>Anne Aarts<br />- Anne Vervoort<br />- Bart Alberts<br />- Harm van Hassel<br />- Hein van Tiel<br />- Nick Althuizen</p>', 1, '83', 'ja', 'ja', 'ja', 1),
(89, 'Sponsoren', 'Sponsors', '<h1>Sponsoren</h1>\r\n<p>Op deze pagina vindt u onze sponsoren.<br />Heeft u interesse om Hydrofiel te sponsoren? In de sponsorbrochure (verkrijgbaar bij de penningmeester) staat beschreven hoe u de vereniging kunt sponsoren. Wij staan uiteraard open voor nieuwe manieren van samenwerken. Bent u ge&iuml;nteresseerd in de vereniging of heeft u een vraag of opmerking, wij horen deze graag!</p>\r\n<p>U kunt contact opnemen met de penningmeester via&nbsp;<span style=\"text-decoration: underline;\"><a href=\"mailto:penningmeester@hydrofiel.nl\">penningmeester@hydrofiel.nl</a></span>.</p>\r\n<p>- <span style=\"text-decoration: underline;\"><strong><a href=\"https://www.facebook.com/StadscafeTouT/\">Stadscaf&eacute; TouT</a></strong></span></p>\r\n<p>- <span style=\"text-decoration: underline;\"><strong><a href=\"http://cafejos.nl/\" target=\"_blank\">Caf&eacute; Jos</a></strong></span></p>\r\n<p><strong>- <span style=\"text-decoration: underline;\"><a href=\"http://www.cafe-dekroon.nl/\">Caf&eacute; de Kroon</a></span></strong></p>\r\n<p>- <span style=\"text-decoration: underline;\"><a href=\"http://www.dressmeclothing.nl/\"><strong>Dressme Clothing</strong></a></span></p>\r\n<p>&nbsp;</p>\r\n<p><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/02-09-2015%20152244%20tout_208324677.jpg\" alt=\"\" width=\"205\" height=\"108\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/02-09-2015 152531 Logo-Cafe-Groot-Jos-transparant-v3.png\" alt=\"\" width=\"329\" height=\"79\" />&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/05-01-2017 232028 logo de Kroon_site220 px.png\" alt=\"\" width=\"220\" height=\"115\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/02-09-2015%20152738%20Logo%20DressMeClothing.nl__1.jpg\" alt=\"\" width=\"215\" height=\"106\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>', '<h1>Sponsoren</h1>\r\n<p>Op deze pagina vindt u onze sponsoren.<br />Heeft u interesse om Hydrofiel te sponsoren? In de sponsorbrochure (verkrijgbaar bij de penningmeester) staat beschreven hoe u de vereniging kunt sponsoren. Wij staan uiteraard open voor nieuwe manieren van samenwerken. Bent u ge&iuml;nteresseerd in de vereniging of heeft u een vraag of opmerking, wij horen deze graag!</p>\r\n<p>U kunt contact opnemen met de penningmeester via&nbsp;<span style=\"text-decoration: underline;\"><a href=\"mailto:penningmeester@hydrofiel.nl\">penningmeester@hydrofiel.nl</a></span>.</p>\r\n<p>- <span style=\"text-decoration: underline;\"><strong><a href=\"https://www.facebook.com/StadscafeTouT/\">Stadscaf&eacute; TouT</a></strong></span></p>\r\n<p>- <span style=\"text-decoration: underline;\"><strong><a href=\"http://cafejos.nl/\" target=\"_blank\">Caf&eacute; Jos</a></strong></span></p>\r\n<p><strong>- <span style=\"text-decoration: underline;\"><a href=\"http://www.cafe-dekroon.nl/\">Caf&eacute; de Kroon</a></span></strong></p>\r\n<p>- <span style=\"text-decoration: underline;\"><a href=\"http://www.dressmeclothing.nl/\"><strong>Dressme Clothing</strong></a></span></p>\r\n<p>&nbsp;</p>\r\n<p><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/02-09-2015%20152244%20tout_208324677.jpg\" alt=\"\" width=\"205\" height=\"108\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/02-09-2015 152531 Logo-Cafe-Groot-Jos-transparant-v3.png\" alt=\"\" width=\"329\" height=\"79\" />&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/05-01-2017 232028 logo de Kroon_site220 px.png\" alt=\"\" width=\"220\" height=\"115\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/02-09-2015%20152738%20Logo%20DressMeClothing.nl__1.jpg\" alt=\"\" width=\"215\" height=\"106\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>', 1, '83', 'ja', 'ja', 'ja', 0),
(93, 'Statuten en HR', 'Statutes and HR', '<h1>Documenten</h1>\r\n<p>Op deze pagina vind je verschillende documenten die je kan downloaden. Voorbeelden van documenten zijn de notulen van de ALV, het Huishoudelijk Regelement en de Statuten.</p>\r\n<p><span xss=\"removed\"><a href=\"/files/Huishoudelijk Regelement Hydrofiel.pdf\" target=\"_blank\"><strong>Huishoudelijk Reglement (HR)</strong></a></span></p>\r\n<p><span xss=\"removed\"><a href=\"/files/Statuten Hydrofiel.pdf\" target=\"_blank\"><strong>Statuten</strong></a></span></p>\r\n<p><span xss=\"removed\"><strong>ALV stukken:</strong></span><br>Halfjaarlijkse ALV 20-03-2017</p>\r\n<p><a href=\"/files/Agenda halfjaarlijkse ALV 20-03-2017.pdf\">Agenda Halfjaarlijkse ALV</a><br><a href=\"/files/Notulen wissel-ALV 28-09-2016.pdf\">Notulen wissel-ALV 28-09-2016</a><br><a href=\"/files/Halfjaarverslag penningmeester.pdf\">Halfjaarverslag Penningmeester</a><br><a href=\"/files/Halfjaarverslag secretariaat.pdf\">Halfjaarverslag Secretariaat</a></p>\r\n<p> </p>\r\n<p>Wissel ALV 11-09-2017</p>\r\n<p><a href=\"/files/Agenda wissel ALV 11-09-2017.pdf\" target=\"_blank\">Agenda wissel-ALV 11-09-2017</a><br><a href=\"/files/Notulen halfjaarlijkse ALV 20-03-2017.pdf\" target=\"_blank\">Notulen halfjaarlijkse ALV 20-03-2017</a><br><a href=\"/files/Financieel jaarverslag wissel ALV 11-09-2017.pdf\" target=\"_blank\">Financieel jaarverslag </a><br><a href=\"/files/Meerjarenplan Hydrofiel 2017-2022.pdf\" target=\"_blank\">Meerjarenplan</a></p>', '<h1>Documenten</h1>\r\n<p>Op deze pagina vind je verschillende documenten die je kan downloaden. Voorbeelden van documenten zijn de notulen van de ALV, het Huishoudelijk Regelement en de Statuten.</p>\r\n<p><span xss=\"removed\"><a href=\"/files/Huishoudelijk Regelement Hydrofiel.pdf\" target=\"_blank\"><strong>Huishoudelijk Reglement (HR)</strong></a></span></p>\r\n<p><span xss=\"removed\"><a href=\"/files/Statuten Hydrofiel.pdf\" target=\"_blank\"><strong>Statuten</strong></a></span></p>\r\n<p><span xss=\"removed\"><strong>ALV stukken:</strong></span><br>Halfjaarlijkse ALV 20-03-2017</p>\r\n<p><a href=\"/files/Agenda halfjaarlijkse ALV 20-03-2017.pdf\">Agenda Halfjaarlijkse ALV</a><br><a href=\"/files/Notulen wissel-ALV 28-09-2016.pdf\">Notulen wissel-ALV 28-09-2016</a><br><a href=\"/files/Halfjaarverslag penningmeester.pdf\">Halfjaarverslag Penningmeester</a><br><a href=\"/files/Halfjaarverslag secretariaat.pdf\">Halfjaarverslag Secretariaat</a></p>\r\n<p> </p>\r\n<p>Wissel ALV 11-09-2017</p>\r\n<p><a href=\"/files/Agenda wissel ALV 11-09-2017.pdf\" target=\"_blank\">Agenda wissel-ALV 11-09-2017</a><br><a href=\"/files/Notulen halfjaarlijkse ALV 20-03-2017.pdf\" target=\"_blank\">Notulen halfjaarlijkse ALV 20-03-2017</a><br><a href=\"/files/Financieel jaarverslag wissel ALV 11-09-2017.pdf\" target=\"_blank\">Financieel jaarverslag </a><br><a href=\"/files/Meerjarenplan Hydrofiel 2017-2022.pdf\" target=\"_blank\">Meerjarenplan</a></p>', 1, '83', 'ja', 'ja', 'ja', 1),
(94, 'BEP', 'BEP', '<h1>BEP</h1>\r\n<p><img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/11-11-2015 142941 BEP.jpg\" alt=\"\" width=\"225\" height=\"168\"></p>\r\n<p>De BEP is het clubblad van Hydrofiel dat 4 keer per jaar wordt uitgegeven. De BEP is bij uitstek de mogelijkheid om eens lekker te roddelen over je mede-Hydrofielers. Het komt maar al te vaak voor dat je een zatte opmerking van jezelf terugleest, terwijl je zelf niet eens meer wist dat je die gemaakt had of een foto van jezelf ziet die je slapeloze nachten bezorgt. Daarnaast is de BEP hetÂ boekje waar je verslagen van activiteiten, de gezichten bij de namen van de nieuwe leden, leuke weetjes over Nijmegen (zoals de beste kebab-zaak, het lekkerste park of de gezelligste kroeg) en Hydrofiel en haar leden terugvindt.</p>\r\n<p><br>De BEP wordt in het zwembad uitgedeeld. Vaak staat er een doos op een van de banken langs het bad. Kun je de BEP niet vinden? Vraag er dan even naar bij een BEP-commissie-lid!</p>\r\n<p><br>Heb jij nog mooie quotes, foto\'s of ander schoons dat je je mede-hydrofielers niet onthouden mag worden? Stuur deze dan naar  <span xss=\"removed\"><a href=\"mailto:bep.hydrofiel@gmail.com\">bep.hydrofiel@gmail.com</a></span>.<br><br>Heb je de papieren versie van de BEP gemist? Hieronder vind je de BEPs die dit jaar zijn uitgegeven.</p>\r\n\r\n<p><strong>BEP jaargang 39 (2018)<br><a href=\"https://www.hydrofiel.nl/files/BEP I 2018.pdf\">BEP 1</a><br><a href=\"https://www.hydrofiel.nl/files/BEP II 2018.pdf\">BEP 2</a><br><br>BEP jaargang 38 (2017)<br></strong><strong><a href=\"/files/BEP 1 2016-2017.pdf\" target=\"_blank\">BEP 1</a><br><a href=\"/files/Bep jaargang 38 nummer 2 2016-2017 PDF juiste versie.pdf\" target=\"_blank\">BEP 2</a><br><a href=\"/files/BEP jaargang 38 nummer 3 2016-2017 kleur PDF.pdf\" target=\"_blank\">BEP 3</a><br><a href=\"/files/BEP4 2016-2017 kleur.pdf\" target=\"_blank\">BEP 4</a></strong></p>', '<h1>BEP</h1>\r\n<p><img class=\"img-responsive\" src=\"//hydrofiel.nl/fotos/11-11-2015 142941 BEP.jpg\" alt=\"\" width=\"225\" height=\"168\"></p>\r\n<p>De BEP is het clubblad van Hydrofiel dat 4 keer per jaar wordt uitgegeven. De BEP is bij uitstek de mogelijkheid om eens lekker te roddelen over je mede-Hydrofielers. Het komt maar al te vaak voor dat je een zatte opmerking van jezelf terugleest, terwijl je zelf niet eens meer wist dat je die gemaakt had of een foto van jezelf ziet die je slapeloze nachten bezorgt. Daarnaast is de BEP hetÂ boekje waar je verslagen van activiteiten, de gezichten bij de namen van de nieuwe leden, leuke weetjes over Nijmegen (zoals de beste kebab-zaak, het lekkerste park of de gezelligste kroeg) en Hydrofiel en haar leden terugvindt.</p>\r\n<p><br>De BEP wordt in het zwembad uitgedeeld. Vaak staat er een doos op een van de banken langs het bad. Kun je de BEP niet vinden? Vraag er dan even naar bij een BEP-commissie-lid!</p>\r\n<p><br>Heb jij nog mooie quotes, foto\'s of ander schoons dat je je mede-hydrofielers niet onthouden mag worden? Stuur deze dan naar  <span xss=\"removed\"><a href=\"mailto:bep.hydrofiel@gmail.com\">bep.hydrofiel@gmail.com</a></span>.<br><br>Heb je de papieren versie van de BEP gemist? Hieronder vind je de BEPs die dit jaar zijn uitgegeven.</p>\r\n\r\n<p><strong>BEP jaargang 39 (2018)<br><a href=\"https://www.hydrofiel.nl/files/BEP I 2018.pdf\">BEP 1</a><br><a href=\"https://www.hydrofiel.nl/files/BEP II 2018.pdf\">BEP 2</a><br><br>BEP jaargang 38 (2017)<br></strong><strong><a href=\"/files/BEP 1 2016-2017.pdf\" target=\"_blank\">BEP 1</a><br><a href=\"/files/Bep jaargang 38 nummer 2 2016-2017 PDF juiste versie.pdf\" target=\"_blank\">BEP 2</a><br><a href=\"/files/BEP jaargang 38 nummer 3 2016-2017 kleur PDF.pdf\" target=\"_blank\">BEP 3</a><br><a href=\"/files/BEP4 2016-2017 kleur.pdf\" target=\"_blank\">BEP 4</a></strong></p>', 1, '83', 'ja', 'ja', 'ja', 1),
(95, 'Werkacties', 'Work activities', '<h1>Werkacties</h1>\r\n<p>Zoals uitgelegd bij het kopje \"lidmaatschap\" is het concept werkactie bedacht om de contributie voor de leden te reduceren. Ieder lid van Hydrofiel is verplicht om ten minste één werkactie uit te voeren of deze af te betalen. De kosten van één werkactie voor seizoen 2018-2019 zijn op de ALV vastgesteld op: €25.- Als je ervoor kiest om een werkactie af te betalen, betaal je dus 25 euro aan Hydrofiel. Echter wanneer je ervoor kiest om een werkactie uit te voeren, bespaar je jezelf 25 euro.</p>\r\n<p>Het aantal verplichte werkacties voor het seizoen 2017-2018 is op de ALV als volgt vastgesteld:</p>\r\n<table width=\"314\" xss=\"removed\">\r\n<tbody>\r\n<tr>\r\n<td>- Zwemmen</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo recreatief</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo competitief Heren</td>\r\n<td>2 werkacties</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo competitief Dames</td>\r\n<td>2 werkacties</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>De boete voor het niet komen opdagen op een aangemeldde werkactie bedraagt €10.-<br><br> Als lid van Hydrofiel heb je gedurende het jaar verschillende mogelijkheden om een werkactie te vervullen. Zo is er iedere maand de mogelijkheid om een werkactie te vervullen bij het RSC (Radboud Sport Centrum). Daarnaast kun je een werkactie vervullen bij de Zevenheuvelenloop, Marikenloop of Stevensloop. Daar waar Hydrofiel een financiële vergoeding ontvangt voor de werkacties, worden de universiteit en de organisatie van de eerder genoemde hardloopevenementen geholpen aan tijdelijke medewerkers. Met het geld dat Hydrofiel ontvangt, worden onder andere leuke activiteiten voor de leden georganiseerd. Kortom kun je de werkactie ook zien als iets doen in het belang van de vereniging. <br><br>Het doen van een werkactie kan een manier zijn om andere mensen binnen de vereniging te leren kennen en is daardoor vaak ook gezellig en leuk om te doen. <br><br>Om aan één werkactie te voldoen moet je één keer tentamentafeltjes \'s ochtends inruimen én \'s middags uitruimen (liefst op dezelfde dag) in het RSC of minstens 4,5 uur meehelpen bij de Zevenheuvelenloop, Marikenloop of Stevensloop (wanneer je nog geen 19 jaar oud bent, moet je minstens 8,5 uur meehelpen bij eerder genoemde hardloopevenementen). <br><br>Over mogelijke werkacties ontvang je als lid altijd mail. Daarnaast staan de werkacties ook onder het kopje \"agenda\" op de site vermeld. Wanneer je een werkactie wil vervullen, kun je als reactie op de eerder genoemde mail aangeven welke werkactie je wil vervullen. <br><br>Voor meer informatie, vragen of opmerkingen, kun je een mail sturen naar Yvon Wintjes op commissarisalgemeen@hydrofiel.nl</p>', '<h1>Werkacties</h1>\r\n<p>Zoals uitgelegd bij het kopje \"lidmaatschap\" is het concept werkactie bedacht om de contributie voor de leden te reduceren. Ieder lid van Hydrofiel is verplicht om ten minste één werkactie uit te voeren of deze af te betalen. De kosten van één werkactie voor seizoen 2018-2019 zijn op de ALV vastgesteld op: €25.- Als je ervoor kiest om een werkactie af te betalen, betaal je dus 25 euro aan Hydrofiel. Echter wanneer je ervoor kiest om een werkactie uit te voeren, bespaar je jezelf 25 euro.</p>\r\n<p>Het aantal verplichte werkacties voor het seizoen 2017-2018 is op de ALV als volgt vastgesteld:</p>\r\n<table width=\"314\" xss=\"removed\">\r\n<tbody>\r\n<tr>\r\n<td>- Zwemmen</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo recreatief</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo competitief Heren</td>\r\n<td>2 werkacties</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo competitief Dames</td>\r\n<td>2 werkacties</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>De boete voor het niet komen opdagen op een aangemeldde werkactie bedraagt €10.-<br><br> Als lid van Hydrofiel heb je gedurende het jaar verschillende mogelijkheden om een werkactie te vervullen. Zo is er iedere maand de mogelijkheid om een werkactie te vervullen bij het RSC (Radboud Sport Centrum). Daarnaast kun je een werkactie vervullen bij de Zevenheuvelenloop, Marikenloop of Stevensloop. Daar waar Hydrofiel een financiële vergoeding ontvangt voor de werkacties, worden de universiteit en de organisatie van de eerder genoemde hardloopevenementen geholpen aan tijdelijke medewerkers. Met het geld dat Hydrofiel ontvangt, worden onder andere leuke activiteiten voor de leden georganiseerd. Kortom kun je de werkactie ook zien als iets doen in het belang van de vereniging. <br><br>Het doen van een werkactie kan een manier zijn om andere mensen binnen de vereniging te leren kennen en is daardoor vaak ook gezellig en leuk om te doen. <br><br>Om aan één werkactie te voldoen moet je één keer tentamentafeltjes \'s ochtends inruimen én \'s middags uitruimen (liefst op dezelfde dag) in het RSC of minstens 4,5 uur meehelpen bij de Zevenheuvelenloop, Marikenloop of Stevensloop (wanneer je nog geen 19 jaar oud bent, moet je minstens 8,5 uur meehelpen bij eerder genoemde hardloopevenementen). <br><br>Over mogelijke werkacties ontvang je als lid altijd mail. Daarnaast staan de werkacties ook onder het kopje \"agenda\" op de site vermeld. Wanneer je een werkactie wil vervullen, kun je als reactie op de eerder genoemde mail aangeven welke werkactie je wil vervullen. <br><br>Voor meer informatie, vragen of opmerkingen, kun je een mail sturen naar Yvon Wintjes op commissarisalgemeen@hydrofiel.nl</p>', 1, '83', 'ja', 'ja', 'ja', 1),
(96, 'Merchandise', 'Merchandise', '<h1>Merchandise</h1>\r\n<p>Als Hydrofiel hebben we ook een paar artikelen te koop van onze vereniging. Mooi oranje is niet lelijk en natuurlijk wil je aan iedereen laten zien hoe Hard en Nat je bent. Als je één van deze artikelen wilt kopen, neem dan contact op met de penningmeester via: <a href=\"mailto:penningmeester@hydrofiel.nl\">penningmeester@hydrofiel.nl</a> </p>\r\n<p>Artikelen:</p>\r\n<ul xss=\"removed\">\r\n    <li>Badmuts à € 5,00</li>\r\n    <li>Hydrofieltrui à € 16,00</li>\r\n    <li>Hydrofieltas à € 21,70</li>\r\n    <li>Oranje sportshirt à € 15,00</li>\r\n    <li>Donkerblauw sportbroekje à € 13,00</li>\r\n</ul>\r\n<p>Je kunt een aantal artikelen bestellen via MTB sport. Je vindt de link naar de pagina <a href=\"http://www.mtb-sport.net/nl/verenigingen-kleding/hydrofiel.html\" target=\"_blank\">hier</a>. Hieronder staan plaatjes van de producten. Erop klikken brengt je naar de desbetreffende pagina van MTB.</p>\r\n<div class=\"table-responsive\">\r\n<table class=\"table\">\r\n    <tbody><tr>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151328 waterpolobadpak_4.jpg\" alt=\"\" width=\"237\" height=\"237\"></td>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151332 zwembadpak_2017.jpg\" alt=\"\" width=\"262\" height=\"262\"></td>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151321 polobroek.jpg\" alt=\"\" width=\"222\" height=\"222\"></td>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151251 jako-sporttasche-pro-1940-19.jpg\" alt=\"\" width=\"237\" height=\"237\"></td>\r\n    </tr>\r\n    <tr>\r\n        <td>Waterpolobadpak</td>\r\n        <td>Zwembadpak</td>\r\n        <td>Polobroek</td>\r\n        <td>Hydrofiel sporttas</td>\r\n    </tr>\r\n</tbody></table>\r\n</div>', '<h1>Merchandise</h1>\r\n<p>Als Hydrofiel hebben we ook een paar artikelen te koop van onze vereniging. Mooi oranje is niet lelijk en natuurlijk wil je aan iedereen laten zien hoe Hard en Nat je bent. Als je één van deze artikelen wilt kopen, neem dan contact op met de penningmeester via: <a href=\"mailto:penningmeester@hydrofiel.nl\">penningmeester@hydrofiel.nl</a> </p>\r\n<p>Artikelen:</p>\r\n<ul xss=\"removed\">\r\n    <li>Badmuts à € 5,00</li>\r\n    <li>Hydrofieltrui à € 16,00</li>\r\n    <li>Hydrofieltas à € 21,70</li>\r\n    <li>Oranje sportshirt à € 15,00</li>\r\n    <li>Donkerblauw sportbroekje à € 13,00</li>\r\n</ul>\r\n<p>Je kunt een aantal artikelen bestellen via MTB sport. Je vindt de link naar de pagina <a href=\"http://www.mtb-sport.net/nl/verenigingen-kleding/hydrofiel.html\" target=\"_blank\">hier</a>. Hieronder staan plaatjes van de producten. Erop klikken brengt je naar de desbetreffende pagina van MTB.</p>\r\n<div class=\"table-responsive\">\r\n<table class=\"table\">\r\n    <tbody><tr>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151328 waterpolobadpak_4.jpg\" alt=\"\" width=\"237\" height=\"237\"></td>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151332 zwembadpak_2017.jpg\" alt=\"\" width=\"262\" height=\"262\"></td>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151321 polobroek.jpg\" alt=\"\" width=\"222\" height=\"222\"></td>\r\n        <td><img class=\"img-responsive\" src=\"/fotos/29-08-2017 151251 jako-sporttasche-pro-1940-19.jpg\" alt=\"\" width=\"237\" height=\"237\"></td>\r\n    </tr>\r\n    <tr>\r\n        <td>Waterpolobadpak</td>\r\n        <td>Zwembadpak</td>\r\n        <td>Polobroek</td>\r\n        <td>Hydrofiel sporttas</td>\r\n    </tr>\r\n</tbody></table>\r\n</div>', 1, '83', 'ja', 'ja', 'ja', 0),
