(112, 'Training', 'Training', '<h1>Waterpolotraining</h1>\r\n<p>De waterpolotak van Hydrofiel traint twee keer per week in het Erica Terpstrabad:</p>\r\n<ul>\r\n<li>Dinsdag: 21.00 uur - 22.30 uur</li>\r\n<li>Donderdag: 21.00 uur - 22.30 uur</li>\r\n</ul>\r\n<p>Tijdens deze trainingen trainen de Dames en Heren samen.</p>\r\n<p><strong>Trainers<br></strong>Na heel veel jaren ervaring bij verschillende clubs geeft <strong>Marco van Beuningen </strong>sinds seizoen 2015-2016 training bij Hydrofiel. Hij verzorgt zowel de dinsdag- als de donderdagtraining en is daarnaast vaak als coach aanwezig bij de wedstrijden van de teams.</p>\r\n<p>Marco is zeer actief binnen de waterpolowereld en waterpolobond. Hij vervult onder andere de functie van waterpoloscheidsrechter op eredivisieniveau. <br></p>\r\n<p><img class=\"img-responsive\" src=\"/fotos/05-01-2016 123710 marco van beuningen.jpg\" alt=\"\" width=\"269\" height=\"202\">Het training geven doet Marco niet in zijn eentje. Hij staat tweemaal per week samen aan het bad met onze tweede trainer <b>Theo Hermens</b>. Theo heeft na een lange tijd van waterpolo spelen, zijn zwembroek ingeruild voor een fluitje en tactiekbord en verzorgt met veel enthousiasme zijn trainingen. <br><strong></strong></p><p><strong>Trainingen</strong><br>Samen verzorgen ze zeer diverse trainingen, waarbij de verschillende facetten van de waterpolosport aan bod komen. Tijdens een training wordt er gezwommen met en zonder bal, getraind op snelheid en conditie, geoefend met verschillende spelsituaties en gefocust op verbetering van de techniek. Kortom, geen enkele training is hetzelfde.</p>\r\n<p><strong>Meetrainen?</strong><br>Ben je benieuwd naar de waterpolotrainingen? Wil je graag een keer meetrainen? Mail dan naar <span xss=\"removed\"><a href=\"mailto:waterpolocommissaris@hydrofiel.nl\">waterpolocommissaris@hydrofiel.nl</a></span>. Onze waterpolocommissaris kan je dan meer informatie geven over de trainingen en trainingstijden van die week. Als je mee komt trainen, neem dan altijd je sportkaart mee!</p>\r\n<p> </p>', '<h1>Waterpolotraining</h1><p>The waterpolo teams train two times a week at the Erica Terpstra pool. </p><ul><li>Thuesday: 21.00 - 22.30 <br></li><li>Thursday: 21.00 - 22.30 <br></li></ul><p>The men and women train together.</p><p><strong>Trainer</strong><br></p><p>Marco van Beuningen is our coach since 2015-2016. He is responsible for the Thuesday and Thuisday training and is often present during the games in the weekends.</p><p>\r\nMarco is really active within the waterpoloworld and waterpolo federation. Hij is a referee at the premier league level. </p><p><img class=\"img-responsive\" src=\"https://test.bintzandt.nl/fotos/05-01-2016 123710 marco van beuningen.jpg\" alt=\"\" width=\"269\" height=\"202\">He doesn\'t provide his trainings alone. Twice a week he will be on the side of the pool together with <b>Theo Hermens. </b>After a long time playing waterpolo himself, he has exchanged his speedo for a whistle and a tactics-map. He provides his trainings with a lot of enthusiasm. <br><strong></strong></p><p><strong>Trainings</strong><br>Together they provide for unique trainings twice a week, different aspect of waterpolo will be dealth with. During a training you will swim with and without ball, you will train your speed, condition and will learn the game. Not one training is the same. </p><p>\r\n<strong>Join a training?</strong><br>Are je interested in a waterpolo training? Do you want to join a training? This is possible! Send an email to: waterpolocommissaris@hydrofiel.nl . She will provide you with more information and will make sure someone waits for you in the pool. <br><br><br></p>', 1, '79', 'ja', 'ja', 'ja', 0),
(106, 'Lidmaatschap', 'Membership', '<h1>Lidmaatschap</h1>\r\n<p>Wil je lid worden van Hydrofiel? Inschrijven kan door middel van het invullen van het aanmeldingsformulier, verkrijgbaar bij het bestuur. Zodra de inschrijving is verwerkt, ontvang je een welkomstbrief.</p>\r\n<p><strong>Voorwaarden</strong><br>Om lid te kunnen worden van Hydrofiel dien je te studeren aan een Universiteit of Hogeschool. Leden mogen tot twee jaar na afstuderen (x+2) lid blijven.</p>\r\n<h3>Contributie</h3>\r\n<p>Met ondertekening van het aanmeldingsformulier verleen je Hydrofiel toestemming om contributie en deelnamekosten te innen.<br>De contributie bestaat uit twee eenheden, namelijk contributie en werkactie.</p>\r\n<p><span xss=removed>Contributie</span><br>De vereniging maakt onderscheid tussen zwemmers, waterpolo-recreatief en waterpolo-competitief (KNZB). De contributie voor seizoen 2017/2018 is op de ALV vastgesteld.</p>\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td>- Zwemmen (zonder startvergunning)</td>\r\n<td>€ 20.-</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - recreatief (zonder startvergunning/waterpolokaart)</td>\r\n<td>\r\n<p>€ 20.-</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - competitief (inclusief startvergunning/waterpolokaart) </td>\r\n<td>€ 100.-</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span xss=removed>Werkactie</span><br>Naast het betalen van contributie zijn alle leden verplicht om een of twee werkacties uit te voeren of deze af te kopen. Het concept \'werkacties\' is bedacht om de contributie te kunnen reduceren. De verdeling van de werkacties is als volgt vastgesteld op de ALV:</p>\r\n<div class=\"table-responsive\">\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td>- Zwemmen</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - recreatief</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - competitief Heren </td>\r\n<td>2 werkacties</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - competitief Dames</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>De kosten van één werkactie voor seizoen 2017-2018 zijn op de ALV vastgesteld op: €25.-<br>De boete voor het niet komen opdagen op een werkactie waarvoor je aangemeld stond bedraagt €10.-</p>\r\n<h3>Sportkaart</h3>\r\n<p>Tevens moet je als lid van Hydrofiel in het bezit zijn van een geldige sportkaart van het RSC (Radboud Sport Centrum).</p>\r\n<p>De studentensportkaart kan digitaal worden aangevraagd of verlengd via: <a href=\"https://registratie.usc.ru.nl/inschrijving/publiek/\" target=\"_blank\"><span xss=removed>https://registratie.usc.ru.nl/inschrijving/publiek/</span></a>. <br>Alumni die meer dan een jaar, maar minder dan drie jaar geleden zijn afgestudeerd (x+2 regeling en x+3 regeling) komen ook in aanmerking voor een studentensportkaart, maar tegen een hoger tarief. Je kunt je inschrijven bij de balie van het RSC, zie <a href=\"http://www.ru.nl/sportcentrum/ikwil/sportkaart-aanvragen/alumni/\" target=\"_blank\"><span xss=removed>http://www.ru.nl/sportcentrum/ikwil/sportkaart-aanvragen/alumni/</span></a> voor meer informatie.</p>\r\n<h3>Startvergunning</h3>\r\n<p>Als je aan zwemwedstrijden mee wilt doen buiten de studentencompetitie, dan heb je een startvergunning nodig.</p>\r\n<div class=\"table-repsonsive\">\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td>- Dagvergunning</td>\r\n<td>€ 6,70</td>\r\n</tr>\r\n<tr>\r\n<td>- Startvergunning</td>\r\n<td>€ 33,75</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>Wil je een startvergunning, neem dan contact op met de secretaris. Startvergunningen lopen per kalenderjaar (1 januari - 31 december). Wil je je startvergunning opzeggen? Stuur dan een mail naar <span xss=removed><a href=\"mailto:secretaris@hydrofiel.nl\">secretaris@hydrofiel.nl</a></span>.</p>\r\n<h3>Uitschrijven</h3>\r\n<p>Wij hopen natuurlijk dat iedereen staat te popelen om te blijven trainen bij onze mooie vereniging! Mocht dit nu niet het geval zijn, stuur dan een mail naar <span xss=removed><a href=\"mailto:secretaris@hydrofiel.nl\">secretaris@hydrofiel.nl</a></span> voor 31 augustus. Als je jezelf uitschrijft na 31 augustus wordt het lidmaatschap automatisch verlengd en ben je voor het volgende seizoen contributie verschuldigd.<br><br>Waterpoloërs die competitief spelen, moeten zichzelf uitschrijven voor 1 juli van het betreffende seizoen.</p>', '<h1>Lidmaatschap</h1>\r\n<p>Wil je lid worden van Hydrofiel? Inschrijven kan door middel van het invullen van het aanmeldingsformulier, verkrijgbaar bij het bestuur. Zodra de inschrijving is verwerkt, ontvang je een welkomstbrief.</p>\r\n<p><strong>Voorwaarden</strong><br>Om lid te kunnen worden van Hydrofiel dien je te studeren aan een Universiteit of Hogeschool. Leden mogen tot twee jaar na afstuderen (x+2) lid blijven.</p>\r\n<h3>Contributie</h3>\r\n<p>Met ondertekening van het aanmeldingsformulier verleen je Hydrofiel toestemming om contributie en deelnamekosten te innen.<br>De contributie bestaat uit twee eenheden, namelijk contributie en werkactie.</p>\r\n<p><span xss=removed>Contributie</span><br>De vereniging maakt onderscheid tussen zwemmers, waterpolo-recreatief en waterpolo-competitief (KNZB). De contributie voor seizoen 2017/2018 is op de ALV vastgesteld.</p>\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td>- Zwemmen (zonder startvergunning)</td>\r\n<td>€ 20.-</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - recreatief (zonder startvergunning/waterpolokaart)</td>\r\n<td>\r\n<p>€ 20.-</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - competitief (inclusief startvergunning/waterpolokaart) </td>\r\n<td>€ 100.-</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span xss=removed>Werkactie</span><br>Naast het betalen van contributie zijn alle leden verplicht om een of twee werkacties uit te voeren of deze af te kopen. Het concept \'werkacties\' is bedacht om de contributie te kunnen reduceren. De verdeling van de werkacties is als volgt vastgesteld op de ALV:</p>\r\n<div class=\"table-responsive\">\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td>- Zwemmen</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - recreatief</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - competitief Heren </td>\r\n<td>2 werkacties</td>\r\n</tr>\r\n<tr>\r\n<td>- Waterpolo - competitief Dames</td>\r\n<td>1 werkactie</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>De kosten van één werkactie voor seizoen 2017-2018 zijn op de ALV vastgesteld op: €25.-<br>De boete voor het niet komen opdagen op een werkactie waarvoor je aangemeld stond bedraagt €10.-</p>\r\n<h3>Sportkaart</h3>\r\n<p>Tevens moet je als lid van Hydrofiel in het bezit zijn van een geldige sportkaart van het RSC (Radboud Sport Centrum).</p>\r\n<p>De studentensportkaart kan digitaal worden aangevraagd of verlengd via: <a href=\"https://registratie.usc.ru.nl/inschrijving/publiek/\" target=\"_blank\"><span xss=removed>https://registratie.usc.ru.nl/inschrijving/publiek/</span></a>. <br>Alumni die meer dan een jaar, maar minder dan drie jaar geleden zijn afgestudeerd (x+2 regeling en x+3 regeling) komen ook in aanmerking voor een studentensportkaart, maar tegen een hoger tarief. Je kunt je inschrijven bij de balie van het RSC, zie <a href=\"http://www.ru.nl/sportcentrum/ikwil/sportkaart-aanvragen/alumni/\" target=\"_blank\"><span xss=removed>http://www.ru.nl/sportcentrum/ikwil/sportkaart-aanvragen/alumni/</span></a> voor meer informatie.</p>\r\n<h3>Startvergunning</h3>\r\n<p>Als je aan zwemwedstrijden mee wilt doen buiten de studentencompetitie, dan heb je een startvergunning nodig.</p>\r\n<div class=\"table-repsonsive\">\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<td>- Dagvergunning</td>\r\n<td>€ 6,70</td>\r\n</tr>\r\n<tr>\r\n<td>- Startvergunning</td>\r\n<td>€ 33,75</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>Wil je een startvergunning, neem dan contact op met de secretaris. Startvergunningen lopen per kalenderjaar (1 januari - 31 december). Wil je je startvergunning opzeggen? Stuur dan een mail naar <span xss=removed><a href=\"mailto:secretaris@hydrofiel.nl\">secretaris@hydrofiel.nl</a></span>.</p>\r\n<h3>Uitschrijven</h3>\r\n<p>Wij hopen natuurlijk dat iedereen staat te popelen om te blijven trainen bij onze mooie vereniging! Mocht dit nu niet het geval zijn, stuur dan een mail naar <span xss=removed><a href=\"mailto:secretaris@hydrofiel.nl\">secretaris@hydrofiel.nl</a></span> voor 31 augustus. Als je jezelf uitschrijft na 31 augustus wordt het lidmaatschap automatisch verlengd en ben je voor het volgende seizoen contributie verschuldigd.<br><br>Waterpoloërs die competitief spelen, moeten zichzelf uitschrijven voor 1 juli van het betreffende seizoen.</p>', 1, '83', 'ja', 'ja', 'ja', 0),
(108, 'Clublied', 'Clubsong', '<h1>Clublied</h1>\r\n<p>Hee Hee</p>\r\n<p>Hier zijn we<br>In het zwembad<br>We lusten jullie rauw<br>Ook al zijn we dan op tien procent na allemaal vrouw</p>\r\n<p>Hydrofielers overheersen zowel bad als krat<br>Ga maar vast naar huis<br>Want wij zijn Hard en Nat</p>\r\n<p>HYDROFIEL<br>HARD EN NAT (x3)</p>\r\n<p><img class=\"img-responsive\" src=\"/fotos/02-02-2016 213603 FB_IMG_1448915075386.jpg\" alt=\"\" width=\"328\" height=\"218\"></p>', '<h1>Clublied</h1>\r\n<p>Hee Hee</p>\r\n<p>Hier zijn we<br>In het zwembad<br>We lusten jullie rauw<br>Ook al zijn we dan op tien procent na allemaal vrouw</p>\r\n<p>Hydrofielers overheersen zowel bad als krat<br>Ga maar vast naar huis<br>Want wij zijn Hard en Nat</p>\r\n<p>HYDROFIEL<br>HARD EN NAT (x3)</p>\r\n<p><img class=\"img-responsive\" src=\"/fotos/02-02-2016 213603 FB_IMG_1448915075386.jpg\" alt=\"\" width=\"328\" height=\"218\"></p>', 1, '83', 'ja', 'ja', 'ja', 0),
(109, 'Bestuur', 'Board', '<p></p><p><b>Het 47e bestuur van N.S.Z.&W.V. Hydrofiel</b></p><p>Op 10 september 2018 is het 47e bestuur als volgt geconstitueerd:<br><br>Voorzitter: Renée Schrijen<br>Secretaris: Vincent van \'t Hof<br>Penningmeester: Luuk Janssen<br>Zwemcommissaris: Torben Lammerdink<br>Waterpolocommissaris: Leonie Pastoor<br>Commissaris Algemeen: Yvon Wintjes</p>', '<p></p><p><b>The 47th board of N.S.Z.&W.V. Hydrofiel</b></p><p>On September 10th, 2018, the 47th board was established as follows:<br><br>Chair: Renée Schrijen<br>Secretary: Vincent van \'t Hof<br>Treasurer: Luuk Janssen<br>Swimming Commissioner: Torben Lammerdink<br>Water polo Commissioner: Leonie Pastoor<br>General Commissioner: Yvon Wintjes</p>', 1, '83', 'ja', 'ja', 'ja', 0),
(121, 'Wedstrijden', 'Matches', '<iframe src=\"https://www.knzb.nl/verenigingen/wedstrijdsport/waterpolo/uitslagen_waterpolo/iframe/verenigingen/vereniging/DHS016V/\" width=\"100%\" height=\"700\">', '<iframe src=\"https://www.knzb.nl/verenigingen/wedstrijdsport/waterpolo/uitslagen_waterpolo/iframe/verenigingen/vereniging/DHS016V/\" width=\"100%\" height=\"700\">', 1, '79', 'ja', 'ja', 'ja', 0);
INSERT INTO `pagina` (`id`, `naam`, `engelse_naam`, `tekst`, `engels`, `plaats`, `submenu`, `zichtbaar`, `bereikbaar`, `cmspagina`, `ingelogd`) VALUES
(123, 'Trainen', 'Training', '<h1>Zwemtraining</h1>\r\n<p>De zwemtak van Hydrofiel traint twee keer per week in het Erica Terpstrabad:</p>\r\n<ul>\r\n<li>Dinsdag: 20.00 uur - 21.00 uur</li>\r\n<li>Donderdag: 20.00 uur - 21.00 uur</li>\r\n</ul>\r\n<h2>Trainers</h2>\r\n<p><strong>Marit Polman</strong>: Marit is een jonge enthousiaste trainster die om de week onze trainingen verzorgt op dinsdag. Marit heeft na heel water jaartjes het zwemmen bij Hydrofiel verruild voor het geven van trainingen. Vanaf seizoen 2016-2017 maakt Marit de trainingen.</p>\r\n<p><strong>Lieke Jager:</strong> net als Marit is ook Lieke een jonge gedreven trainster die om de twee weken de dinsdagavond training verzorgt. Lieke was voorheen ook een fanatieke zwemmer bij Hydrofiel.   <strong> </strong> </p>\r\n<p><strong>Sarah Drenth:</strong> Sarah heeft al enige tijd haar trainersdiploma en is sinds september 2016 de vaste trainer op de donderdagavond. Zelf zwemt ze al twee jaar bij Hydrofiel en probeert ze nog steeds om elke dinsdagavond mee te trainen.</p>\r\n<p>Al onze trainsters zijn gediplomeerd in het geven van trainingen. </p>\r\n<table class=\"table table-responsive\"><tbody><tr><td><img class=\"img-responsive\" src=\"/fotos/18-12-2015 121919 10169334644_38627a9a5e_o.jpg\" alt=\"\" width=\"132\" height=\"199\"></td><td><img class=\"img-responsive note-float-left\" src=\"/fotos/18-12-2015 125638 282950_10201680845328635_1534846639_n.jpg\" alt=\"\" width=\"178\" height=\"188\"></td><td><img class=\"img-responsive note-float-left\" src=\"/fotos/25-09-2017 121803 Sarah foto.jpg\" alt=\"Sarah foto\" width=\"199\" height=\"186\"></td></tr><tr><td>Marit Polman</td><td>Lieke Jager</td><td>Sarah Drenth</td></tr></tbody></table>\r\n<p><strong>Trainingen<br></strong>Zoals gezegd worden de dinsdagtrainingen verzorgd door Lieke en Marit en de donderdagtraining door Sarah. Op donderdagavond is er van 20.00 tot 21.00 een hulptrainer aanwezig. Dit is een zwemmer die door meerdere keren per jaar op de donderdagavond mee te helpen bij de training voldoet aan zijn werkactie.<br>Voor het seizoen 2018 - 2019 zijn dat de volgende hulptrainers:<br>- Jan van Aken<br>- Emma Arends<br>- Celine Bolwerk<br>- Lizzy Janssen<br>- Sjoerd Murk<br>- Marieke Robbers<br>- Maudy Ruiter<br>- Lysanne Schepper</p>\r\n<p>Een training start standaard met een vaste afstand inzwemmen. Afhankelijk van waar we zijn in het seizoen wordt de rest van de training ingevuld. Een aantal voorbeelden:</p>\r\n<ul>\r\n<li>Vlak voor een NSZK wordt er vaak meer getraind op starten, keerpunten en sprinten.</li>\r\n<li>In aanloop naar de jaarlijkse zwemmarathon (100x100meter) trainen we op langere afstanden.</li>\r\n<li>Critical Swim Speed (CSS) training (zo\'n 3 à 4 keer per jaar): de CSS is de snelheid of 100 meter tijd die aangeeft waar jouw aerobe drempel ligt. Op zo\'n training wordt bijvoorbeeld 1 x 400m en 1 x 200 m borstcrawl op hard tempo gezwommen. Op basis van de tijden die hieruit voortkomen kun je doeltijden stellen voor bepaalde setjes trainingen.</li>\r\n<li>Techniek trainingen waarbij soms gebruik gemaakt wordt van Ipads die zowel onder- als bovenwater kunnen filmen. Op deze manier kun je zelf kijken hoe je slag eruit ziet, om zo een groter begrip te krijgen over de juist techniek. </li></ul>\r\n<p>De training zijn dus erg divers. Dit maakt een training nooit saai en daardoor erg leuk! </p>\r\n<h2>Meetrainen?</h2>\r\n<p>Wil je een keertje meetrainen om te kijken hoe een zwemtraining bij Hydrofiel er precies uitziet? Dit kan! Stuur een mailtje naar <a href=\"mailto:bestuur@hydrofie.nl\">bestuur@hydrofiel.nl</a>. Het bestuur geeft je meer informatie over de trainingen en zorgt ervoor dat er iemand voor je klaar staat in het zwembad. Als je mee komt trainen, neem dan altijd je sportkaart mee!</p>\r\n<p> </p>', '<p><br></p><h1>Swimtraining</h1><p>              The swimming branche at Hydrofiel trains twice a week in the  Erica Terpstra pool:            </p><ul><li>Tuesday: 20.00h - 21.00h</li><li>Thursday: <span>20.00h - 21.00h</span></li></ul><p>\r\n<br></p><h2>Trainers</h2><p><strong>Marit Polman</strong>:               Marit is a young, enthousiastic trainer, who every other  week takes care of the training at tuesday. After many years in the water,  Marit traded     swimming for providing training. Also since season 2016 -  2017 Marit designs the trainings.            </p><p><strong>Lieke Jager:</strong>               Just like Marit, Lieke also is a driven trainer, who takes  care of the tuesday trainings every other tuesday. Lieke also previously was a  fanatic     swimmer at Hydrofiel.            </p><p><strong>Sarah Drenth:</strong>               Sarah possesses a degree in training swimmers for some time  now. Since september 2016 she is the main trainer at the thursday evenings. She  also     swims at Hydrofiel for the last two years and she still  tries to participate each tuesday evening.            </p><p>              All our trainers are graduated at providing trainings.            </p><table class=\"table table-responsive\"><tbody><tr><td><img class=\"img-responsive\" src=\"https://test.bintzandt.nl/fotos/18-12-2015 121919 10169334644_38627a9a5e_o.jpg\" alt=\"\" width=\"132\" height=\"199\"></td><td><img class=\"img-responsive note-float-left\" src=\"https://test.bintzandt.nl/fotos/18-12-2015 125638 282950_10201680845328635_1534846639_n.jpg\" alt=\"\" width=\"178\" height=\"188\"></td><td><img class=\"img-responsive note-float-left\" src=\"https://test.bintzandt.nl/fotos/25-09-2017 121803 Sarah foto.jpg\" alt=\"Sarah foto\" width=\"199\" height=\"186\"></td></tr><tr><td>Marit Polman</td><td>Lieke Jager</td><td>Sarah Drenth</td></tr></tbody></table><p>\r\n<br></p><p><strong>Trainings</strong></p><p>              As said before, tuesday trainings are taken care of by Lieke  and Marit and thursdays by Sarah. On Thursdays Sarah is helped by a assistant  trainer. An assistant     trainer is participant is appointed by Hydrofiel in helping  several times each year at providing trainings.            </p><p>For the season of 2018-2018 these are: <br>- Jan van Aken<br>- Emma Arends<br>- Celine Bolwerk<br>- Lizzy Janssen<br>- Sjoerd Murk<br>- Marieke Robbers<br>- Maudy Ruiter<br>- Lysanne Schepper</p><p>\r\n</p><p><br></p><p>              Each training starts with swimming for a fixed distance.  Depending on the time in the season, the remaining of the training then will be  filled with     different exercises. Some examples:</p><ul><li>Technical trainings, sometimes with the use of I-pads,  which are able to record your movements above, as well as below the surface. At    <span>  </span>your aerobic  threshhold. At such a training there will be swum, for example 1x400 m and  1x200m breast crawl at high speed. </li><li>Just before a match there\'ll be more focus on turing  points and sprints    * In the run-up for the yearly marathon (100x100 meters) we  train at long distances </li><li>Critical Swim Speed (CSS) training (about 3 to 4 times a  year): the CSS is the speed or 100 meter-time that point out           <spantimes new=\"\" mso-bidi-theme-font:minor-bidi;mso-ansi-language:nl;mso-fareast-language:en-us;=\"\">your aerobic threshhold. At such a training there will  be swum, for example 1x400 m and 1x200m breast crawl at high speed. </spantimes>Based on the  resulting times, you\'ll be able to set your target times for certain sets of  training.            </li></ul><p>              Hence the trainings are very divers, why it will allways be  a lot of fun to go!            </p><h2>Participate in a training?</h2><p>              Would you like to join a training, to see, what it looks  like at Hydrofiel? Just send a mail to zwemcommissaris@hydrofiel.nl. Our  swimcommisioner then will     send you some more information about which trainings are  planned for that week. If you participate, please bring your sports card.            <br></p><p><br></p><p>\r\n<br></p><p> </p><p><br></p>', 1, '78', 'ja', 'ja', 'ja', 0),
(131, 'Privacy', 'Privacy', '<p><a href=\"https://www.hydrofiel.nl/files/Privacy verklaring N_S_Z_&W_V_ Hydrofiel augustus 2018.pdf\" target=\"_blank\">Privacy Overeenkomst</a><br></p>', '<p>    <a href=\"https://www.hydrofiel.nl/files/Privacy verklaring N_S_Z_&W_V_ Hydrofiel augustus 2018.pdf\" target=\"_blank\">Privacy Agreement</a><span><span> </span>(sadly in Dutch, a translation is in the works)</span>    <br></p>', 1, '83', 'ja', 'ja', 'ja', 0);

